import React, {Component, Fragment} from 'react';
import {Container, Nav, Navbar} from "react-bootstrap";

class TopNavigation extends Component {
    onScroll

    constructor() {
        super();
        this.state = {
            navBarTitle: "navTitle"
        }
    }

    onScroll = () => {
        if (window.scroll > 100) {
            this.setState({navBarTitle: 'navTitleScroll'})
        } else if (window.scroll < 100) {
            this.setState({navBarTitle: 'navTitle'})
        }
    }

    componentDidMount() {
        window.addEventListener('scroll', this.onScroll)
    }

    render() {
        return (
            <Fragment>
                <Navbar fixed={"top"} collapseOnSelect expand="lg" bg="dark" variant="dark">
                    <Container>
                        <Navbar.Brand className={this.state.navBarTitle} href="#home">Real Estate Company</Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="me-auto">

                            </Nav>
                            <Nav>
                                <Nav.Link href="#deets">HOME</Nav.Link>
                                <Nav.Link href="#deets">SERVICES</Nav.Link>
                                <Nav.Link href="#deets">COURSES</Nav.Link>
                                <Nav.Link href="#deets">PORTFOLIO</Nav.Link>
                                <Nav.Link href="#deets">CONTACT</Nav.Link>
                                <Nav.Link href="#deets">ABOUT ME</Nav.Link>

                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>

            </Fragment>
        )
            ;
    }
}

export default TopNavigation;
